    id,
    total,
    cliente: { nombre, telefono, email },
    estado,
    cliente,
  } = pedido;

  console.log(id);
  console.log(total);
  console.log(cliente);
  console.log(estado);
  console.log(nombre);
  console.log(telefono);

  return 'Desde Pedido';
}
